import React from 'react'
import { withRouter } from 'react-router-dom'

const RecipeHeader = (props) => {
    console.log(props)
    return ( 
        <header>
            <div className="title-container">
                <h1 className="recipe-title">{props.recipe.name}</h1>
            </div>
            <div className="recipe-controls-primary">
                <button className="btn-warning" onClick={() => {props.deleteRecipe() && props.history.push('/')}}>Delete Recipe</button>
            </div>
        </header>
    )
}

export default withRouter(RecipeHeader)
